import React from 'react'
import { useFood } from '../context'


const CartItems = () => {

    const { food_list , cartItems } = useFood();

  return (
    <div className='grid grid-cols-6 pt-10 bg-gray-500' >
        <div>Items</div>
        <div>Title</div>
        <div>Price</div>
        <div>Quantity</div>
        <div>Total</div>
        <div>Remove</div>
        {
            food_list.map( (food ) => {
                if( cartItems[food.id] > 0 ){
                    return (
                        <div>
                            <div>{food.name}</div>
                        </div>
                    )
                }    
            })
        }
    </div>
  )
}

export default CartItems
